# Subarray Product Less Than K

# Algo: if we add a new value to the right of the window and the answer is still < k,
# the new value will contribute (right - left + 1) new sub arrays.
class Solution:
    def numSubarrayProductLessThanK(self, nums: [int], k: int) -> int:
        res = 0
        product = 1
        left, right = 0, 0

        if k <= 1:
            return res

        while right < len(nums):
            product = product * nums[right]
            if product < k:
                res = res + (right - left + 1)
                right += 1
            else:
                while product >= k and product != 1:
                    product = product / nums[left]
                    left += 1
                if product < k:
                    res = res + (right - left + 1)
                right += 1
        return res


